INSERT INTO `patientreview` (`sr`, `date`, `name`, `address`, `review`, `profile`, `link`) VALUES
(25, '14-02-2023 1:45 pm', 'Poonam Upadhyay', 'Sindura, Varanasi', 'I am Poonam Upadhyay from Varanasi, I am 55 years old, and I was suffering from CKD and had to go for dialysis thrice a week, when I got admitted to BK Arogyam, my creatinine was 12.51, after 2 months of treatment my creatinine came down to 5.5, I was very happy when my dialysis was stopped and I continued my medicine. After 1 month now my creatinine is 0.78. I had absolutely no hope whether I would survive or not. I would like to thank BK Arogyam who gave me a normal life.', 'static/images/patients-review/Manish Tiwari (2)02142023134508.webp', 'n9n_Ct7f_iU');
